import React from 'react';
import './Footer.css';
function Footer() {
    return (
        <footer className="footer">
            <div className="footer__title">Учебный проект Яндекс.Практикум х BeatFilm.</div>
            <nav className="footer__items">
                <p className="footer__copyright">&copy; 2023</p>
                <ul className="footer__links">
                    <li>
                        <a href="https://yandex.ru/pogoda" target="_blank" className="footer__link">Яндекс.Практикум</a>
                    </li>
                    <li>
                        <a href="https://yandex.ru/pogoda" target="_blank" className="footer__link">Github</a>
                    </li>
                </ul>
            </nav>
        </footer>
    );
}

export default Footer;
